import React, { useEffect, useState } from 'react';
import axios from 'axios';

const SuperAdminReports = () => {
  const [summary, setSummary] = useState({});
  const [delayedRequests, setDelayedRequests] = useState([]);
  const [residentCount, setResidentCount] = useState(0);

  useEffect(() => {
    fetchReportData();
  }, []);

  const fetchReportData = async () => {
    try {
      const [summaryRes, delayedRes, residentsRes] = await Promise.all([
        axios.get('/api/superadmin/request-summary'),
        axios.get('/api/superadmin/delayed-requests'),
        axios.get('/api/superadmin/resident-count')
      ]);

      setSummary(summaryRes.data);
      setDelayedRequests(delayedRes.data);
      setResidentCount(residentsRes.data);
    } catch (error) {
      console.error('Error loading report data:', error);
    }
  };

  return (
    <div className="p-6">
      <h2 className="text-2xl font-bold mb-4">Reports</h2>

      <div className="mb-6">
        <h3 className="text-xl font-semibold">Overall Request Summary</h3>
        <ul className="list-disc pl-5">
          <li>Total Requests: {summary.total}</li>
          <li>Completed: {summary.completed}</li>
          <li>Rejected: {summary.rejected}</li>
        </ul>
      </div>

      <div className="mb-6">
        <h3 className="text-xl font-semibold">Delayed Requests</h3>
        {delayedRequests.length === 0 ? (
          <p>No delayed requests</p>
        ) : (
          <ul className="list-disc pl-5">
            {delayedRequests.map((req) => (
              <li key={req.id}>{req.serviceType} - Delay: {req.daysDelayed} days</li>
            ))}
          </ul>
        )}
      </div>

      <div>
        <h3 className="text-xl font-semibold">Total Resident Count</h3>
        <p>{residentCount}</p>
      </div>
    </div>
  );
};

export default SuperAdminReports;
